Want your kitty featured? We offer features in 3 different ways!

1. General Features:
By using our hashtag(#) & tagging(@) us in your posts, you'll be entered for a chance to be featured! We choose features randomly, so the more you submit posts, the better your chances of being featured are as we get hundreds of submissions each day! (See our "Get Featured" story highlight for more info)

2. Paid Features:
By purchasing a feature from us, you will 100% guarantee your kitty a feature on our page instead of competing against hundreds of other posts for the chance of being featured. This also gives you the opportunity for something that general features don't! The ability to customize your own feature exactly the way you want it with our 6 different customization levels! 😺 (See our "Paid Features" story highlight & DM us to inquire!)

3. T-Shirts:
Everyone who shows their support by purchasing a @takeyourcatoutside T-Shirt is guaranteed a feature along with it 💚 (See our "T-Shirts" story highlight & DM us to inquire)

For tips on how to Harness & Leash train your cat, check out the full 3 part "Training Guide" in our story highlights!

*Disclaimer*
We promote INDOOR cats that are taken outside safely & responsibly on leashes & under close supervision. We do NOT condone letting your cats outside unsupervised (Outdoor Cats.) Not to confuse the two.
